import React from 'react'
import NewCard from "./NewCard"

function NewContainer({artworks}) {

  const newCard = artworks.map((artwork)=> (
      <NewCard 
        key={artwork.title}
        artworks={artwork}
      />
  ))

  return (
    <ul className="cards">
      {newCard} 
    </ul>
  )
}

export default NewContainer
